function DisplaySimpson(props) {
  const { quote, character, characterDirection, image } = props.quoteList;
  console.log(props.quoteList);
  return (
    <ul>
      <li>{quote}</li>
      <li>{character}</li>
      <img src={image} alt={character} />
      <li>{characterDirection}</li>
    </ul>
  );
}
export default DisplaySimpson;
